import React from "react";
import "../stylesheets/case-studies.css";
import CaseStudyQuickshow from "./CaseStudyQuickshow";

const CaseStudies = () => {
  return (
    <div id="case-studies-wrapper">
      <p>Case Studies</p>
      <div id="case-study-quickshow-wrapper">
        <ul>
          <li><CaseStudyQuickshow /></li>
          <CaseStudyQuickshow />
          <CaseStudyQuickshow />
          <CaseStudyQuickshow />
        </ul>
      </div>
    </div>
  );
};

export default CaseStudies;
